        // Given the lower and upper limits of integration x1 and x2, and given n, this routine returns
        // arrays x[1..n] and w[1..n] of length n, containing the abscissas and weights of the Gauss-
        // Legendre n-point quadrature formula.
        // From numerical recipes.
        void GenerateGaussLegendreNodesAndWeights(double x1, double x2, double* x, double* w, int n);

        /// \todo This is kind of a hack to get things working in rtrt.
        template<typename Type>
        class GaussLegendreNodesAndWeights
        {
        public:
            static const unsigned int MAX_SIZE = 100;

            static void InitializeNodesAndWeights()
            {
                if( alreadyInit ) return;

                alreadyInit = true;
                nodes.resize(MAX_SIZE);
                weights.resize(MAX_SIZE);

                const double x1 = -1.0;
                const double x2 = 1.0;

                for(int n = 1; n < static_cast<int>(MAX_SIZE); ++n)
                {
                    std::vector<Type>* node = new std::vector<Type>(n+2);
                    std::vector<Type>* weight = new std::vector<Type>(n+2);
                    nodes[n] = node;
                    weights[n] = weight;

                    //double tempNodes[5000];
                    //double tempWeights[5000];
                    //zwglj(tempNodes, tempWeights, n, 0, 0);
                    //for( int i = 0; i < n; ++i)
                    //{
                    //  (*node)[i] = tempNodes[i];
                    //  (*weight)[i] = tempWedights[i];
                    //}
                    const Type EPS = 1.0e-13;
                    int m,i;
                    int j = 0;
                    Type z1,z,xm,xl,pp,p3,p2,p1;  //High precision is a good idea for this routine.
                    m=(n+1)/2; //The roots are symmetric in the interval, so we only have to nd half of them.
                    xm=0.5*(x2+x1);
                    xl=0.5*(x2-x1);
                    for (i=1;i<=m;i++)
                    { //Loop over the desired roots.
                        z=cos(3.141592654*(i-0.25)/(n+0.5));
                        // Starting with the above approximation to the ith root, we enter the main loop of
                        // renement by Newton's method.
                        do
                        {
                            p1=1.0;
                            p2=0.0;
                            for (j=1;j<=n;j++)
                            {
                                // Loop up the recurrence relation to get the
                                // Legendre polynomial evaluated at z.
                                p3=p2;
                                p2=p1;
                                p1=((2.0*j-1.0)*z*p2-(j-1.0)*p3)/j;
                            }
                            // p1 is now the desired Legendre polynomial. We next compute pp, its derivative,
                            // by a standard relation involving also p2, the polynomial of one lower order.
                            pp=n*(z*p1-p2)/(z*z-1.0);
                            z1=z;
                            z=z1-p1/pp; //Newton's method.
                        }
                        while (fabs(z-z1) > EPS);

                        (*node)[i-1]=xm-xl*z; // Scale the root to the desired interval,
                        (*node)[n+1-i-1]=xm+xl*z; // and put in its symmetric counterpart.
                        (*weight)[i-1]=2.0*xl/((1.0-z*z)*pp*pp); // Compute the weight
                        (*weight)[n+1-i-1]=(*weight)[i-1]; //and its symmetric counterpart.
                    }
                }
            }

            static void GenerateGaussLegendreNodesAndWeights(const std::vector<Type>*& x,
                const std::vector<Type>*& w, unsigned int n)
            {
                InitializeNodesAndWeights();
                assert(n < MAX_SIZE);
                x = nodes[n-1];
                w = weights[n-1];
            }

            static std::vector<std::vector<Type>* > nodes;
            static std::vector<std::vector<Type>* > weights;
            static bool alreadyInit;

        };

        template<typename Type> bool GaussLegendreNodesAndWeights<Type>::alreadyInit = false;
        template<typename Type> std::vector<std::vector<Type>* > GaussLegendreNodesAndWeights<Type>::nodes;
        template<typename Type> std::vector<std::vector<Type>* > GaussLegendreNodesAndWeights<Type>::weights;

